function Education(props) {
  const propsEdu = props.propsEdu
  const listEdu = propsEdu.map((item) => (
    <div className="relative overflow-hidden">
      <div className="relative flex flex-col gap-8 px-4 sm:px-6 lg:px-8">
        <h3></h3>
      </div>
    </div>
  ))
  return (
    <section id="education" className="relative flex flex-col items-center gap-12 min-h-[50vh] py-16">
      <div className="flex flex-col items-center justify-center gap-12">
        {listEdu}
      </div>
    </section>
  )
}
export default Education;
